import React,{useState}  from 'react';
import axios from 'axios';
const Login=()=>{
  const [email,serEmail]=useState('');
  const [password,serPassword]=useState('');
  const formHandle=async(e)=>{
    try{
   e.preventDefault();
   axios.defaults.withCredentials=true;
   const res= await axios.post('http://localhost:3001/login',{email,password})
   alert(res.data.message)
   }catch(error){
     alert(error.message)
   }
   e.target.email.value="";
  }
  return <>
  <form onSubmit={formHandle}>
  <div>Email:<input type="email" name="email" placeholder="Inter your Email" onChange={(e)=>serEmail(e.target.value)} /></div>
   <div>Password:<input type="password" name="passsword" placeholder="Enter Your User Password" onChange={(e)=>serPassword(e.target.value)} /></div>
    <div><button type="submit">sign In</button></div>
  </form>
  </>
}
export default Login
